import React from 'react'

const HeaderComponent = () => {
    return (
            <div>
                <header style={{textAlign: 'center'}}>
                    <nav className="navbar navbar-expand-md navbar-dark bg-dark" style={{display: 'block'}}>
                    <div className="navbar-brand"> User Data</div>
                    </nav>
                </header>
            </div>
    );
}

export default HeaderComponent
